import React from 'react';
import {Card, Row, Col,Tag} from 'antd';
import { HeartOutlined, CommentOutlined } from '@ant-design/icons'
import './Article.css';

const { Meta } = Card;



const Article = (props) => {
    return (
        <Card
        hoverable
        style={{ width: 240 }}
        cover={<img alt="example" src="https://assets.entrepreneur.com/content/3x2/2000/20191219170611-GettyImages-1152794789.jpeg" />}
        >
        <Meta title="Artcile Title is her" description="Article description is here as you see" />
        <Row  className="container" gutter={{ xs: 8, sm: 56, md: 2, lg: 50 }}>
            <Col className='gutter-row' span={25}>
                <HeartOutlined />
            </Col>
            <Col className='gutter-row' span={25}>
                <CommentOutlined />
            </Col>
        </Row>
        <Row  className="container"  gutter={{ xs: 8, sm: 56, md: 2, lg: 50 }}>
            <Tag color="magenta">magenta</Tag>
            <Tag color="red">red</Tag>
            <Tag color="volcano">volcano</Tag>
            <Tag color="orange">orange</Tag>
            <Tag color="gold">gold</Tag>
        </Row>
      </Card>
    );

}

export default Article;
